INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(10000206, 1, 0, 'Silence, traitor! We purge the world in the name of the Light! Your weakness will not sway us!', 12, 0, 100.0, 5, 0, 0, 0, 0, 'Herod add talk 2');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(10000206, 0, 0, 'Faithless! You betray the Crusade?!', 12, 0, 100.0, 6, 0, 0, 0, 0, 'HerdD Defeat add betray talk');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(10000194, 5, 0, 'This form is no longer mine...', 14, 0, 100.0, 0, 0, 0, 0, 0, 'BFD Melanas 6');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(10000194, 4, 0, 'Though I may serve you now, Old One, I will not bow to your will!', 14, 0, 100.0, 0, 0, 0, 0, 0, 'BFD Melanas 5');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(10000194, 3, 0, 'I have nothing left to lose.', 12, 0, 100.0, 0, 0, 0, 0, 1, 'BFD Melanas 4');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(10000194, 2, 0, '(The voice chuckles, an unsettling sound that fills the air) Power comes at a price. Are you willing to pay it?', 41, 0, 100.0, 0, 0, 0, 0, 1, 'BFD Melanas 3');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(10000194, 1, 0, 'I crave power, Old One. Power to survive this accursed land and carve out my own domain.', 14, 0, 100.0, 0, 0, 0, 0, 1, 'BFD Melanas 2');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(10000194, 0, 0, '(A deep, guttural voice echoes from the darkness) Speak your desire...', 41, 0, 100.0, 0, 0, 0, 0, 1, 'BFD Melenas 1');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(10000108, 0, 0, 'You fool! Do you grasp the nature of the crystal you''ve trifled with? Do not tamper with forces beyond understanding. Your ignorance will cost you dearly.', 14, 0, 100.0, 1, 0, 0, 0, 0, 'Darkshore Melanas Text Yell');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(10000066, 0, 0, 'The Holy Order? I will gladly join them, %n.', 12, 0, 100.0, 1, 0, 10724, 0, 0, 'Scarlet Recruit encouraged to join');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(10000023, 0, 0, 'Foolish mortal! You have led me right to your demise. Now the Nightmare will consume all of Azeroth!', 12, 0, 100.0, 0, 0, 0, 0, 0, 'Melanas talk on summon');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000069, 0, 0, 'Todays flight code is Leeroy Jenkins!', 12, 0, 100.0, 1, 0, 0, 0, 0, 'Airstrip Pilot wrong password');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000067, 0, 0, 'Oh, todays flight code is Tauren Truffles.', 12, 0, 100.0, 1, 0, 0, 0, 0, 'Airstrip Talk Pilot correct password');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000060, 0, 0, 'Thank you for not leaving me to the scourge. I know it might not have been what you would have preferred, $C, but I am happy to return the favour. Do you need anything?', 12, 0, 100.0, 0, 0, 0, 0, 0, 'Ghostlands captive freed 2 talk');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000059, 0, 0, 'I appreciate you saving me, $N. Now, is there something I can help you with?', 12, 0, 100.0, 0, 0, 0, 0, 0, 'Ghostlands freed NPC 1');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000058, 1, 0, 'Not... again.', 14, 0, 100.0, 0, 0, 0, 0, 0, 'Scourgefall Line 2');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000058, 0, 0, 'You again?! You have bested me once, but never again! Witness the Power of a Death Knight!', 14, 0, 100.0, 0, 0, 0, 0, 0, 'Scourgefall Line 1');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000057, 0, 0, 'Ah, $N. You are just in time! Or on time? Timely, anyways.', 12, 0, 100.0, 1, 0, 0, 0, 0, 'Chromie ghostlands quest finished talk');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000056, 1, 0, 'But... Lord Murozond said...', 14, 0, 100.0, 0, 0, 0, 0, 0, 'Time Rift Elite NPC Line 2');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000056, 0, 0, 'Bah, this is what we get for sending pathetic Drones. I will finish this, Quel''thalas shall fall!', 14, 0, 100.0, 0, 0, 0, 0, 0, 'Time Rift Elite NPC');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000055, 0, 0, 'You can not stop us!', 14, 0, 100.0, 0, 0, 0, 0, 0, 'Time Rift NPC 2');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000054, 0, 0, 'For the Infinite!', 14, 0, 100.0, 0, 0, 0, 0, 0, 'Time Rift NPC 1');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000051, 1, 0, 'How did you...', 12, 0, 100.0, 0, 0, 0, 0, 0, 'Eversong Elite Mob Quest 1');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000051, 0, 0, 'Predictable fool, Lord Murozond knew you couldn''t resist a challenge! Your time has run out!', 12, 0, 100.0, 0, 0, 0, 0, 0, '');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000050, 1, 0, 'Yrel...the Light has abandoned me but perhaps there is hope after all. ', 12, 0, 100.0, 0, 0, 0, 0, 0, 'Maraad defeat speech');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000050, 0, 0, 'It seems you have found out about my little secret. This could all have been avoided you know...', 12, 0, 100.0, 1, 0, 0, 0, 0, 'Maraad talk when confronted Line 1');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000049, 0, 0, 'This cant be true... Maraad what has happened to you?', 12, 0, 100.0, 0, 0, 0, 0, 0, 'Yrel confront Maraad speech');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000048, 0, 0, 'The Traitor emerges from the shadows!', 41, 0, 100.0, 0, 0, 0, 0, 0, '');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000046, 2, 0, 'We''ve had our share of events, yes. Please send someone when you can, across Crystalbrook River!', 12, 0, 100.0, 1, 0, 0, 0, 0, '');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000046, 1, 0, 'To what do I owe the pleasure?', 12, 0, 100.0, 1, 0, 0, 0, 0, '');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000046, 0, 0, 'Ah, finally, we''ve reestablished contact with Ammenttrath', 12, 0, 100.0, 1, 0, 0, 0, 0, '');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000045, 0, 0, 'As the Light-blessed powder strikes the portal, it destabilizes almost immediately, closing with a wimper. The lake should be safe now.', 41, 0, 100.0, 0, 0, 0, 0, 0, '');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000040, 0, 0, 'We have found a culprit, but there may be more out there. Is there aught to do in Azure Watch?', 12, 0, 100.0, 1, 0, 0, 0, 0, '');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000039, 0, 0, 'Thank you, $N, you''ve done me a great service.', 12, 0, 100.0, 1, 0, 0, 0, 0, 'Alistair Tower dissapears after turn in');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(9000037, 0, 0, 'No, I won''t accept this! My father will protect me!', 12, 0, 100.0, 1, 0, 0, 0, 0, 'Lilian Voss Deathknell Scared');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(2847206, 8, 0, 'As masters of blood, we are masters of life and death itself. Agains us, even hope falls drained and lifeless.', 12, 0, 100.0, 1, 0, 0, 29875, 0, 'Lord Thorval');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(2847206, 7, 0, 'We know power never to be overcome...', 12, 0, 100.0, 1, 0, 0, 29874, 0, 'Lord Thorval');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(2847206, 6, 0, 'We know hunger never to be quenched...', 12, 0, 100.0, 1, 0, 0, 29873, 0, 'Lord Thorval');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(2847206, 5, 0, 'As masters of blood, we know battle without end...', 12, 0, 100.0, 1, 0, 0, 29872, 0, 'Lord Thorval');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(2847206, 4, 0, 'And every foe that falls, energy sapped and stolen, only further fuels our assault.', 12, 0, 100.0, 1, 0, 0, 29871, 0, 'Lord Thorval');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(2847206, 3, 0, 'Stripping energy from our foes, both fighting and fallen, allows us to persevere where lesser beigns falls exhausted.', 12, 0, 100.0, 1, 0, 0, 29870, 0, 'Lord Thorval');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(2847206, 2, 0, 'True masters learn to make blood serve more than just their strength in battle.', 12, 0, 100.0, 1, 0, 0, 29869, 0, 'Lord Thorval');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(2847206, 1, 0, 'Be it by blade or incantation, blood feeds our attacks and weakens our foes.', 12, 0, 100.0, 1, 0, 0, 29868, 0, 'Lord Thorval');
INSERT INTO creature_text (CreatureID, GroupID, ID, `Text`, `Type`, `Language`, Probability, Emote, Duration, Sound, BroadcastTextId, TextRange, comment) VALUES(2847206, 0, 0, 'As disciples of blood, you strive to master the very lifeforce of your enemies.', 12, 0, 100.0, 1, 0, 0, 29867, 0, 'Lord Thorval');
